g hateoas in a reactive application. 
The documentation is still a todo tag, so I explored the code myself and I'm having a hard time to understand how that is supposed to be used.

In regular webMVC workd I have the model assemblers that create an entitymodel<myentity> or the collection in a blocking fashion.

In reactive I have Mono and Flux as returntypes. 

Mono should be easy, Mono<EntityModel<MyEntity>>, so basically I just add a map(...) to the producing chain to create the wrapper as soon as the entity is present.
But the WebFluxBuilder.linkTo returns a Mono, which I don't understand at all. It fetches information readily present on the system and there is no need in any way to return a mono, it just could return the links based on the provided information.

So I end up doing something like that:

```java
@Component
public class ContentItemResourceAssembler implements ReactiveRepresentationModelAssembler<ContentItem, EntityModel<ContentItem>> {
    @Override
    public Mono<EntityModel<ContentItem>> toModel(ContentItem entity, ServerWebExchange exchange) {
        return Mono.just(EntityModel.of(entity,
                linkTo(methodOn(ContentReadController.class).getItems(entity.getTenantId(), entity.getId())).withSelfRel().toMono().block(),
                linkTo(methodOn(ContentBrowseController.class).getItems(entity.getTenantId(), null)).withRel("whatever").toMono().block()
        ));
    }
}
```

It gets worse with collections, the assembler consumes a flux and returns a mono of the collectionModel with the items, which I assume is due to the fact that there is currently no elegant way to return surrounding wrapper with a streamed content. So basically no streaming, when you want to return the collection with collection links.
I assume to be able to have a special Flux with links which remains reactive, but is able to pass the surrounding  links would require to enhance the reactor code to allow the reactive part to happen in a deeper nested part of the answer. Am I right?

So basically my "problem" boils down to:

- Why does the webflux linkto return reactive types?
- Wouldn't it make sense to support the flux<T> to flux<EntityModel<T>> case somehow to have that in an easy way?', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-hateoas/issues/1762/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-hateoas/issues/1762/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-hateoas/issues/comments/1082058354', 'html_url': 'https://github.com/spring-projects/spring-hateoas/issues/1762#issuecomment-1082058354', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-hateoas/issues/1762', 'id': 1082058354, 'node_id': 'IC_kwDOAEDc585AfuZy', 'user': {'login': 'pcornelissen', 'id': 1177440, 'node_id': 'MDQ6VXNlcjExNzc0NDA=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1177440?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/pcornelissen', 'html_url': 'https://github.com/pcornelissen', 'followers_url': 'https://api.github.com/users/pcornelissen/followers', 'following_url': 'https://api.github.com/users/pcornelissen/following{/other_user}', 'gists_url': 'https://api.github.com/users/pcornelissen/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/pcornelissen/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/pcornelissen/subscriptions', 'organizations_url': 'https://api.github.com/users/pcornelissen/orgs', 'repos_url': 'https://api.github.com/users/pcornelissen/repos', 'events_url': 'https://api.github.com/users/pcornelissen/events{/privacy}', 'received_events_url': 'https://api.github.com/users/pcornelissen/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-29T15:57:50Z', 'updated_at': '2022-03-29T15:57:50Z', 'author_association': 'NONE', 'body': 'Example how one might have to use the mono from the builder:

```java
  @PostMapping
    public Mono<ResponseEntity<Void>> getItems(@PathVariable UUID tenantId, @RequestBody ContentItem item) {
        item.setTenantId(tenantId);
        return contentItemRepository.insert(item)
                .doOnSuccess(contentItem -> log.info("Item add: {}", contentItem))
                .doOnError(throwable -> log.error("Could not save! {}", item, throwable))
                .publishOn(Schedulers.boundedElastic())
                .map(contentItem -> ResponseEntity.created(
                        Objects.requireNonNull(linkTo(methodOn(ContentReadController.class).getItems(tenantId, contentItem.getId())).withSelfRel().toMono()
                                .map(Link::toUri)
                                .blockOptional(Duration.ofSeconds(1))
                                .orElseThrow())
                ).build());
    }
```

Would it just return the link, the above could could be simplified:

```java
  @PostMapping
    public Mono<ResponseEntity<Void>> getItems(@PathVariable UUID tenantId, @RequestBody ContentItem item) {
        item.setTenantId(tenantId);
        return contentItemRepository.insert(item)
                .doOnSuccess(contentItem -> log.info("Item add: {}", contentItem))
                .doOnError(throwable -> log.error("Could not save! {}", item, throwable))
                .map(contentItem -> ResponseEntity.created(
                        linkTo(methodOn(ContentReadController.class).getItems(tenantId, contentItem.getId())).withSelfRel().toUri())
                ).build());
    }
